import styled from 'styled-components'

export const TilesContainer = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr 1fr 1fr 1fr;

  @media screen and (max-width: 600px) {
    body {
      color: blue;
    }
  }
`
